import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";
// import About from './components/about/About';
// import Contact from './components/contact/Contact';
// import Footer from './components/footer/Footer';
import Login from './components/login/Login';
// import Main from './components/main/Main';
// import Register from './components/register/Register';
// import Takeinput from './components/takeinput/Takeinput';
// import Textinput from './components/textinput/Textinput';
import Userdata from './context/Userdata';

function App() {
  return (
    <Userdata>
      <Router>

     <Navbar/>

     <Routes>
       <Route exact path="/" element={<Cards category="general" key="general"/>}/>

       <Route exact path="/business" element={<Cards category="business" key="business"/>}/>

       <Route exact path="/entertainment" element={<Cards category="entertainment" key="entertainment"/>}/>

       <Route exact path="/health" element={<Cards category="health" key="health"/>}/>

       <Route exact path="/science" element={<Cards category="science" key="science"/>}/>

       <Route exact path="/sports" element={<Cards category="sports" key="sports"/>}/>

       <Route exact path="/technology" element={<Cards category="technology" key="technology"/>}/>


     </Routes>

 </Router>
    </Userdata>
  );
}

export default App;
